(1, 'China crisis: Soccer rocked by corruption scandals', 2, 'Beijing and London, England (CNN) -- No one thought anything was particularly amiss when Happy Valley lost 2-0 to Fourway Rangers in the Hong Kong First Division last October.\r\n\r\nAfter all, Happy Valley was enduring a miserable season, which would end in a humiliating relegation. The match would have remained an obscure result in one of soccer''s most obscure backwaters, watched by just 442 people at the Sham Shui Po Sports Ground, had it not been revealed that there was something far more sinister than Happy Valley''s ineptitude at work.\r\n\r\nEarlier this month five soccer players were arrested on suspicion of taking bribes from gambling syndicates to throw the match. Four have since been released on bail but one, Yu Yang, was sentenced to 10 months in prison for attempted bribery on 20 May according to the official Chinese press agency, Xinhua.\r\n\r\nThis was not an isolated incident either. Soccer on the Chinese mainland is in crisis, mired in seemingly endless corruption scandals off the pitch, and dogged by woeful performances on it.\r\n\r\nSoccer woes\r\n\r\nChina has missed out on this summer''s World Cup in South Africa, plummeted down the FIFA world ranking and, even worse, the state-run Chinese Super League (CSL) is experiencing its own corruption scandal that has spread to Hong Kong.\r\n\r\nAs well as the five players in Hong Kong, a further 20 officials have been arrested, including former Chinese Football Association (CFA) boss Nan Yong and his deputy Yang Yimin. Two CSL clubs, Guangzhou and Chengdu were relegated from the top division for match fixing, postponing the start of the soccer season.\r\n\r\nMost damaging of all, however, was the arrest of Lu Jun, a former international World Cup referee known as the "Golden Whistle" for his impartiality, on suspicion of taking bribes. If found guilty he could face the death penalty.\r\n\r\n"It was really, really shocking news in China, not just in sports but with everyone, especially when the soccer chief had to step down from the position," Tang Yue, a sports journalist for the government-run China Daily, told CNN.\r\n\r\nHuge market\r\n\r\nIt really shouldn''t have been like this. While Hong Kong, which has its own football association, has a national team that has consistently been ranked as a less than mediocre side in world football, China was seen as the next great hope for spreading the gospel of the "beautiful game."\r\n\r\nSoccer, after all, is China''s most popular sport. It is estimated that anywhere up to 30 million people watch the English Premier League every weekend while 180 million watched last year''s CSL on television.\r\n\r\nVideo: China football probe arrests\r\n\r\nSepp Blatter, the president of football''s governing body FIFA, was so keen to shore up support for the game that when China hosted the 2004 Asian Cup Blatter flew in for the final and controversially declared that it was the Chinese, and not the English, that had invented soccer.\r\n\r\n"You cannot deny the history that in China there is a recollection and evidence [that] they played the game a thousand years ago," Blatter told a soccer expo in Beijing, giving FIFA''s official seal to claims that the ancient sport of "cuju" was the great-grandfather of the modern game.\r\n\r\nEndemic corruption\r\n\r\nIn 2004 money was poured in and the CSL set up with much fanfare. With history and the world''s largest sports market on its side -- a ready made 1.3 billion-strong soccer-crazy population -- China seemed destined to be the game''s next global super power. But now the national team languishes on a world rank of 85, between Moldova and Angola, and there are fears that the true extent of the influence of Chinese betting syndicates has only just begun to be revealed.\r\n\r\n"The CSL was already the third attempt at setting up the league because the other two collapsed due to corruption and fan violence," Rowan Simons, author of Bamboo Goalposts, a recent book about soccer in China, told CNN.\r\n\r\n"There''s corruption at every single level of the game, from the top to the very bottom. It''s an indictment of wider Chinese society and representative of a much bigger problem with corruption and nepotism. It''s more visible with football because your results are taken by your performance in international competition. So there is nowhere to hide. They are 85th in FIFA''s world rankings with a population of over a billion people."\r\n\r\nXinhua reported earlier this year that 106,626 government officials were found guilty of corruption by the Central Commission For Discipline Inspection, the Communist Party''s anti-corruption watchdog in the first 11 months of 2009. Still, according to Transparency International''s Corruption Perceptions Index China is ranked 79th in the world.\r\n\r\nAccording to Simons, corruption in Chinese football is so ingrained that even players at the national level have to pay bribes to get a game.\r\n\r\n"There was even a rate card published in the press," he said. "Â£10,000 ($14,960) to get selected for the national squad. To get a run out as a sub its Â£20,000 ($17,950). Players have come out and said they can''t play for the national team because they can''t afford it." When CNN put these concerns to the CFA they declined to comment.\r\n\r\nGovernment intervention\r\n\r\nThe scandal has generated such bad headlines, however, that the government is now taking the problem extremely seriously. A replacement has been found in the shape of Wei Di, who was in charge of China''s water sports federation and who has no previous experience in soccer.\r\n\r\n"Even the sports minister had to be involved, and President Hu Jintao," explained Tang Yue. "He has said he wants to improve soccer in China. It shows the level of determination [that he is involved]."\r\n\r\nBut this in itself presents another problem. FIFA rules seek to protect soccer officials from government interference. Chad, Kenya, Iraq and Iran have all faced suspension after FIFA claimed they suffered from such meddling. But in China, where the line between government and private involvement has become blurred, no action has been taken.\r\n\r\nIt is this government interference, according to Simons, that has created the space for corruption and match fixing to exist in the first place.\r\n\r\n"Sport is government-owned and government-controlled," Simons said. "People don''t have the same personal responsibility for sport. They don''t think sport is theirs. Football is not the people''s game; it''s the government''s game and always has been in living memory."\r\n\r\nOthers looking at the role of the Chinese government in sport agree that it is this relationship that has helped to undermine the game.\r\n\r\n"The government really needs to loosen its grip," explained Christopher Renner, president of sports consultancy Helios Partners China.\r\n\r\n"Obviously, that''s never going to happen entirely, but they should focus on policy and not the day-to-day running of sports, especially when commercial elements are involved. This is where money comes in and the temptation is too great for these underpaid bureaucrats. At least with football, they need to let market forces have more of an impact on leadership, owners, coaches and players. Those who get results, and not those who play the political game, need to be rewarded."\r\n\r\nBrazil 2014?\r\n\r\nTens of millions of Chinese fans will still tune in to June''s World Cup in South Africa, cheering on adopted teams from South America and Europe. But as Simons points out, whether the Chinese national team makes it to the 2014 finals in Brazil depends largely on their ability to keep soccer clean locally.\r\n\r\n"This is a central government crackdown which you get periodically: lots of people are arrested and [gambling] syndicates broken up," he said. "The football crackdown is wider and deeper than many had predicted. Has it ended everything? No. It has killed everything dead, for now. But it will creep back in if the main issues can''t be addressed."', 1, '2010-05-24 23:16:33'),
(2, 'Party over for Beijing''s Google set', 2, 'Beijing, China (CNN)  -- While all eyes of the tech world were on Google''s annual developer''s conference in San Francisco last week, a recent gathering of the intelligentsia in the world''s largest Internet market went unnoticed.\r\n\r\n"Would you like a Sex on the Beach?" asked the Google China employee behind table covered with copious amounts of wine and liquor as guests arrived in waves -- women in short, summer cocktail dresses and men in untucked shirts and jeans.\r\n\r\nThe Google-China battle over censorship and attacks from Chinese hackers has largely fallen from the headlines after its March decision to move its search operations out of China. But for the Beijing ''Googlers'' that remain, the saga continues as they see their once high cache dwindle and colleagues from the top down depart.\r\n\r\n"Google had this halo of exceptionality around it," said Dan Brody, who was the first employee hired by Google China in 2005.\r\n\r\n"The important thing to remember, like with any other country on the planet, when you try to get hired by Google, you feel so special," said Brody, who worked on strategic partnerships for Google in China before leaving in 2008 to join another Web company in Beijing. "The [new] corporate policy with China hit a lot of Chinese employees like a bucket of cold water in terms of not feeling the love from corporate headquarters."\r\n\r\nMoreover, former employees said the initial excitement and optimism when Google entered the China search market in 2005 was beset by ambivalence from company leaders in Mountain View from the start.\r\n\r\n"Every few months there would be senior level discussions -- ''Why are we in China again?'' -- from the very beginning," said Andy Tian, a former employee at Google China in charge of strategic partnerships in the mobile industry. "As Google grew in China and the issues only got bigger, the more you did, the more the people in the US felt like you were compromising."\r\n\r\nTaking up two floors of a villa in an exclusive apartment complex in central Beijing on a recent Saturday, the so-called "Google networking party" was the talk of the town among tech circles. Anyone who was anybody -- Google employee, or not -- attended.\r\n\r\nFor those outside the Google circle, the Beijing technology community was curious: What, exactly, are they working on after Google decided to shut down its Internet search engine in China and redirect users to its uncensored search engine in Hong Kong. All most know is that the doors to Google''s Beijing offices are open, employees are showing up and they are working -- on something.\r\n\r\nAnd they are also partying -- with each other and with employees from some of China''s biggest Web companies, including what was once Google''s main competitor on the mainland: the search giant Baidu.\r\n\r\nOn the second floor, a patio overlooking Beijing''s always congested highways, a current employee was reticent to discuss the one thing Google outsiders (like this reporter) wanted to know: What''s going on with Google in China now that Google.cn is closed?\r\n\r\n"I will talk to you about Google when I leave Google," said the employee who declined to be quoted by name.\r\n\r\nGoogle acknowledges that stories are rife about what remains of their operations in Beijing and Shanghai, where they also have offices. According to a company statement posted online in Chinese titled "Clearing Up the Rumors," reports that offices have been closed and employees will be laid off are "simply not true."\r\n\r\n"Googlers working in China are in their offices as before, brainstorming products and talking to clients," the statement, which was posted in January, said. (In response to questions raised about the current work in Beijing, a Google spokesperson directed CNN to the online post.)\r\n\r\nIn its now infamous "New Approach to China" blog post, Google said it would retain its research and development team and sales force here. Most recently, Google CEO Eric Schmidt said at a shareholders meeting last week in San Francisco that the situation in China "seems to be stable."\r\n\r\nFar from company sanctioned, the party was organized by an ex-Googler named Jeremy Chau who, after working for the search giant for nearly a decade, left to start an angel investment fund for tech start-ups in 2008.\r\n\r\n"This party had nothing to do with Google. I quit Google. I am not trying to recruit anyone from Google right now," Chau said after the party.\r\n\r\nOther Chinese companies, however, are, as a chorus line of top talent has left the company. Google China''s engineering director Wang Jin joined Baidu in April followed by Zheng Zibin, former technical director of Google China. Song Zhongjia, Google China general sales manager, is now the CEO of the Chinese lifestyle website Aibang.com.\r\n\r\nGoogle, however, says the "leadership team" of its China operations remains intact. But for employees planning their own Google China departure, the search giant told CNN "we respect their decision and wish them good luck."\r\n\r\n"Yeah, of course I receive a lot of calls (from headhunters)," said a former Google employee now working as a human resources manager for a multinational firm that sells networking products. She asked not to be named because she''s not authorized to speak to the press. "They will ask if I still work for Google, and if I know someone who is currently working for Google but willing to explore more opportunities outside."\r\n\r\nBut the "love from corporate headquarters" for its China operations has been lukewarm, at best, for years, according to interviews with several ex-Googlers. For one, Google''s operations here have historically generated only around 5 percent of total revenues for the company.\r\n\r\n"They didn''t take it very seriously," said one of Google''s top scientists who recruited away by Baidu. "Because revenues from China were so small, it was not a big deal for them. That is why I thought I needed to move."\r\n\r\n"(At Baidu) they are all Chinese, and they trust my capabilities," he said. "I can put what I learned into practice."\r\n\r\nTo be sure, many Beijing employees still working for Google say they are content. Yes, top talent has left and the sales team has largely dissolved. But staff is now working on globally focused products, instead of China-specific ones. And Google is still Google, after all.\r\n\r\n"Most people are pretty happy," said a Googler who spoke on the condition of anonymity. "Google is still in a unique position in China. You cannot find any company as open as Google. A lot of exciting products are being developed, so a lot of things are going on. It is very exciting working here."\r\n\r\nThe China team, Google says, has always worked on both global and local projects and continues to do so: "As a result, saying they couldn''t get projects approved by the US isn''t true," a company spokesperson told CNN.\r\n\r\nStill, the disappointment for many is still palpable. The fallout from the search engine''s departure has meant an end to programs employees had been working on for years.\r\n\r\n"Back in the sunny place called California, where there is lots of sunshine and people smile at you on the road and everything is great and where you enjoy your market share and where everyone treats you like God, you want to stick to your principles," Tian said.\r\n\r\n"You don''t appreciate the people who are here in China ... life is harder here. Life is different, and people in the States don''t see that. They don''t appreciate that," Tian said. "They see their so-called principles are getting bent and they don''t like that."', 1, '2010-05-24 23:21:19'),
(3, 'Mourinho the master will bring magic to Madrid', 2, 'A tactical master class in Madrid saw Jose Mourinho give Internazionale their first European Cup since 1965. In two years at the San Siro, the charismatic and controversial Portuguese coach built a team that relied on hard work, discipline and resilience to become kings of the continent once more.\r\n\r\nI saw it coming. Leading up to the semifinal tie against Barcelona, I wrote that Inter would eliminate the defending champions and go on to win the title. My opinion was formed after watching the Italian giants teach Chelsea a footballing lesson that Carlo Ancelotti will not forget anytime soon. So, indeed, they went on to contain the almighty Barca and then prevailed against Bayern.\r\n\r\nThere are many unsung heroes in Interâ€™s line-up. I have always been a big fan of Esteban Cambiasso. The way he plays is so simple and he makes the creative players around him shine. As we say in Portugal, he carries the piano so other ones can play it.\r\n\r\nIt is astounding to me that he has not been picked for Argentinaâ€™s World Cup squad. His compatriot Walter Samuel will be in South Africa and during Interâ€™s victorious campaign he lived up to his nickname of "The Wall." The ferocious tackler was simply insurmountable at the center of Interâ€™s defense.\r\n\r\nBack to Mourinho. I know coaches do not score goals and they do not win games, but he was highly influential throughout Interâ€™s victorious campaign and Saturdayâ€™s final. He spun a defensive web that had the best teams in Europe trapped, dazed and confused, unable to find a way out and unable to break them down.\r\n\r\nHis style has been criticized for its disregard of entertaining football, but you have to respect his managerial skills and ability to get the best out of his players at all times.\r\n\r\nSo what now for Jose? Another fascinating challenge as he takes the reins at Real Madrid. It is a match made in football heaven, isnâ€™t it?\r\n\r\nWell, some may say it is a combustible situation. A mix that would put world''s most high-profile club which has ruthlessly hired and fired ten coaches in as many years in their pursuit of glory, in the hands of a coach who likes to do things his own way and demands loyalty.\r\n\r\nThe explosive potential could lead to disaster, however, we should all know better than that by now. My understanding is that Mourinho has been offered a four-year-deal worth a reputed $12 million per season - a contract that should ensure some much-needed stability in direction for the club.\r\n\r\nEven though Real have not won the European Cup in eight years and have been knocked out in the last 16 consistently, they will be a different proposition with Mourinho.\r\n\r\nHe will surely bring in some familiar faces (Maicon, Diego Milito) that are already well-versed in his football philosophy, and then he will go out and get a star player to complement his midfield.\r\n\r\nSteven Gerrard, Frank Lampard are possibilities. Whoever he gets and however he builds his team, you can be sure of one thing. He will be successful.', 1, '2010-05-24 23:22:15'),
